// import MapGraph from "./mapGraph";

function Map() {
  const lengthAndWidth = (
    <form>
      <label>
        Length:
        <input type="number" name="length" />
      </label>
      <label>
        Width:
        <input type="number" name="width" />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );

  const numberOfCircles = 10;
  const circles = Array.from({ length: numberOfCircles }, (_, index) => index);
  const mapArea = (
    <div
      style={{ width: "500px", height: "500px", backgroundColor: "lightgray" }}
    >
      {circles.map((circle, index) => (
        <div
          key={index}
          style={{
            width: "50px",
            height: "50px",
            backgroundColor: "blue",
            borderRadius: "50%",
            position: "absolute",
            top: `${Math.floor(index / Math.sqrt(circles.length)) * 60}px`,
            left: `${(index % Math.sqrt(circles.length)) * 60}px`,
          }}
        ></div>
      ))}
    </div>
  );

  return (
    <>
      {lengthAndWidth} {mapArea}
    </>
  );
}

export default Map;
